def parseVersionText(pTpktData):
    value = 0
    pData =pTpktData
    count = 0
    bitvalue = 0
    count1 = 1

    while count<=1:
        if(('0'<=(pData + count)) and (pData + count) <='9'):
            bitvalue = (pData+count)-48
        elif (('a'<=(pData + count) and (pData + count) <='f')):
            bitvalue = (pData + count) - 87
        elif (('A' <= (pData + count) and (pData + count) <='F')):
            bitvalue = (pData + count) - 55

        value += bitvalue << (4*count1)
        count1 -=1
        count +=1
    return value
